import React , { useState } from 'react';





const Meal=props=>{
  const [mealData, setmealData] = useState(null);
  // const [recCard, setrecCard] = useState(null);
  // const url= "https://www.themealdb.com/api/json/v1/1/search.php?s="+props.name+""
  
  
    fetch(
        'https://www.themealdb.com/api/json/v1/1/search.php?s=Biryani'
      )
        .then((response) => response.json())
        .then((data) => {
          setmealData(data.meals[0].strInstructions)
        })
        .catch(() => {
          console.log("error");
        });
    
        

    


 
  return (
    <>
   
    <div>
      <h1>{mealData}</h1>
    
    </div>
    </>
  )
}
export default Meal;
